pragma solidity ^0.4.24;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721Token.sol";
import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "./LotteryFactory.sol";

/** @title Tickets */
contract Tickets is ERC721Token, Ownable {

    /** @dev Contains all data about ticket */
    struct Ticket {
        address lottery;
        bytes8 data;
        uint startDraw;
    }

    /** @dev Array where tickets is stored */
    Ticket[] public tickets;

    /** @dev Mapping contains all tickets by owner */
    mapping (address => uint256[]) ticketsByOwner;

    /** @dev Address of the lottery factory contract */
    LotteryFactory public factory;

    /** @dev Used as contract initialization flag */
    bool private isInitialized;

    constructor(string _name, string _symbol) public ERC721Token(_name, _symbol) {}

    /**
     * @dev Mints new ticket to chosen address
     * @param _to Address to mint token to
     * @param _data Ticket data in byte format
     * @param _start Starting draw
     */
    function createTicket(address _to, bytes8 _data, uint _start) external {
        require(factory.isLottery(msg.sender), "Sender must be the lottery");
        require(isInitialized, "Tickets must be initialized");
        uint tokenId = tickets.push(Ticket(msg.sender, _data, _start)) - 1;
        ticketsByOwner[_to].push(tokenId);
        _mint(_to, tokenId);
    }

    /**
     * @dev Returns ticket data
     * @param _ticketId ID of ticket
     * @return Ticket data
     */
    function getTicket(uint256 _ticketId) external view returns (address _lottery, uint8[6] _ticket, uint _draws, bool _power, uint _start) {
        _lottery = tickets[_ticketId].lottery;

        for(uint i=0; i<6; i++) {
            _ticket[i] = uint8(tickets[_ticketId].data[i]);
        }

        _draws = uint(tickets[_ticketId].data[6]);
        _power = (tickets[_ticketId].data[7] != 0);
        _start = tickets[_ticketId].startDraw;
    }

    /** 
     * @dev Initializes Lottery Factory contract. Can be called only once by creator
     * @param _factory Address of the LotteryFactory contract 
     */
    function initLotteryFactory(LotteryFactory _factory) onlyOwner external {
        require(_factory != address(0));
        require(!isInitialized);
        factory = _factory;
        isInitialized = true;
    }
}

